// PodcastList.js
import React from 'react';
import Podcast from 'components./Podcast';

const PodcastList = ({ podcasts }) => (
  <div>
    {podcasts.map(podcast => (
      <Podcast key={podcast.id} podcast={podcast} />
    ))}
  </div>
);

export default PodcastList;
